init.script:
ROYGBIV.requestFullScreen();
ROYGBIV.setFullScreenChangeCallbackFunction(function(isFullScreen){
  if (!isFullScreen){
    ROYGBIV.requestFullScreen();
  }
})
ROYGBIV.globals.orange = "orange";
ROYGBIV.globals.lime = "lime";
var controlInfoText = ROYGBIV.getText("info");
var messText = ROYGBIV.getText("info3");
var githubText = ROYGBIV.getText("github");
ROYGBIV.onTextClick(githubText, function(){
  var redirectWindow = window.open('https://github.com/oguzeroglu/ROYGBIV', '_blank');
  redirectWindow.location;
});
ROYGBIV.setTextColor(controlInfoText, ROYGBIV.globals.lime);
ROYGBIV.setTextColor(messText, ROYGBIV.globals.lime);
ROYGBIV.setTextColor(githubText, ROYGBIV.globals.lime);
ROYGBIV.setTextAlpha(controlInfoText, 0.4);
ROYGBIV.setTextAlpha(messText, 0.4);
ROYGBIV.setTextAlpha(githubText, 0.4);
if (ROYGBIV.isMobile()){
  ROYGBIV.setText(messText, "aim at boxes");
  ROYGBIV.setText(controlInfoText, "pinch: move\nswipe: look");
}else{
  ROYGBIV.globals.textMouseOverFunction = function(){
    ROYGBIV.setTextColor(this, ROYGBIV.globals.orange);
    ROYGBIV.setTextAlpha(this, 0.8);
  }
  ROYGBIV.globals.textMouseOutFunction = function(){
    ROYGBIV.setTextColor(this, ROYGBIV.globals.lime);
    ROYGBIV.setTextAlpha(this, 0.4);
  }
  ROYGBIV.onTextMouseOver(githubText, ROYGBIV.globals.textMouseOverFunction);
  ROYGBIV.onTextMouseOut(githubText, ROYGBIV.globals.textMouseOutFunction);
}

ROYGBIV.setCameraPosition(0, 720, 1000);
ROYGBIV.lookAt(0, 0, 0);

ROYGBIV.globals.reusableVector = ROYGBIV.vector(0, 0, 0);
ROYGBIV.globals.reusableVector2 = ROYGBIV.vector(0, 0, 0);
ROYGBIV.globals.reusableVector3 = ROYGBIV.vector(0, 0, 0);
ROYGBIV.globals.reusableVector4 = ROYGBIV.vector(0, 0, 0);
ROYGBIV.globals.reusableVector5 = ROYGBIV.vector(0, 0, 0);
ROYGBIV.globals.forceCoef = 2.5;
ROYGBIV.globals.positionCtrlFunc = function(obj, objName){
  ROYGBIV.getPosition(obj, ROYGBIV.globals.reusableVector);
  if (ROYGBIV.globals.reusableVector.y <= -500){
    ROYGBIV.setPosition(obj, ROYGBIV.getRandomInteger(-200, 200), ROYGBIV.getRandomInteger(400, 700), ROYGBIV.getRandomInteger(-20, 70));
    ROYGBIV.resetObjectVelocity(obj);
    ROYGBIV.stopObjectTrail(obj);
  }
}

ROYGBIV.globals.modifyObject = function(x, y, z, obj){
  ROYGBIV.setObjectColor(obj, ROYGBIV.globals.orange, 0.33);
  ROYGBIV.setVector(ROYGBIV.globals.reusableVector2, x, y, z);
  ROYGBIV.getCameraPosition(ROYGBIV.globals.reusableVector3);
  ROYGBIV.sub(ROYGBIV.globals.reusableVector2, ROYGBIV.globals.reusableVector3, ROYGBIV.globals.reusableVector3);
  ROYGBIV.globals.reusableVector3.y = -ROYGBIV.globals.reusableVector3.y / 2.5;
  ROYGBIV.multiplyScalar(ROYGBIV.globals.reusableVector3, ROYGBIV.globals.forceCoef, ROYGBIV.globals.reusableVector5);
  ROYGBIV.setObjectVelocity(obj, ROYGBIV.globals.reusableVector5);
  ROYGBIV.startObjectTrail(obj);
}
ROYGBIV.globals.objectMouseOverFunc = function(x, y, z){
  ROYGBIV.globals.modifyObject(x, y, z, this);
  if (ROYGBIV.globals.curMouseOverObjName && ROYGBIV.globals.curMouseOverObjName != this.name){
    ROYGBIV.resetObjectColor(ROYGBIV.getObject(ROYGBIV.globals.curMouseOverObjName));
  }
  ROYGBIV.globals.curMouseOverObjName = this.name;
};
ROYGBIV.executeForEachObject(function(obj, objName){
  if (objName.startsWith("box")){
    ROYGBIV.setObjectMouseOverListener(obj, ROYGBIV.globals.objectMouseOverFunc);
    ROYGBIV.createObjectTrail({
      object: obj, alpha: 0.1, maxTimeInSeconds: 0.15
    });
  }
});


ROYGBIV.runScript("loop");
if (ROYGBIV.isMobile()){
  ROYGBIV.createCrosshair({
    name: "ch1",
    textureName: "crosshair",
    colorName: "white",
    alpha: 1,
    size: 8
  })
  ROYGBIV.selectCrosshair("ch1");
  ROYGBIV.globals.rayFromVector = ROYGBIV.vector(0, 0, 0);
  ROYGBIV.globals.rayDirectionVector = ROYGBIV.vector(0, 0, 0);
  ROYGBIV.globals.rayCallback = function(x, y, z, objName){
    if (objName !== null && objName.startsWith("b")){
      if (ROYGBIV.globals.curLookedAtObjectName && ROYGBIV.globals.curLookedAtObjectName != objName){
        ROYGBIV.resetObjectColor(ROYGBIV.getObject(ROYGBIV.globals.curLookedAtObjectName));
      }
      ROYGBIV.globals.modifyObject(x, y, z, ROYGBIV.getObject(objName));
      ROYGBIV.globals.curLookedAtObjectName = objName;
    }
  }
  ROYGBIV.runScript("lookAtEvent");
}

this.stop();
